// src/AppRouter.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import App from './App';
import OpenPositionsPage from './OpenPositions';

function AppRouter() {
  return (
    <Router>
      <nav>
        <ul>
          <li>
            <Link to="/">Trade Activities</Link>
          </li>
          <li>
            <Link to="/open-positions">Open Positions</Link>
          </li>
        </ul>
      </nav>
      <Routes>
        <Route path="/open-positions">
          
        </Route>
        <Route path="/">
          <App />
        </Route>
      </Routes>
    </Router>
  );
}

export default AppRouter;
